import React , {useState} from "react";
import Container from "@material-ui/core/Container";
import { useDispatch, useSelector } from "react-redux";
import {RootStore} from "./Store";
import {GetUserInfo} from "./Action/UserActions";


function App() {
  const dispatch = useDispatch();
  const [userCount, setUserCount] = useState(0);
  const userSates = useSelector((state: RootStore) => state.userinfo);
  const handleChange = () => setUserCount(5);
  const handleSubmit = () => dispatch(GetUserInfo(userCount));




  return (
    <div className="App">
      <React.Fragment>
        <Container maxWidth="lg">
          {console.log(userSates)}
          {/* <Typography>{state}</Typography> */}
          <button onClick={() => handleChange()}>serch Users</button>
          <button onClick={() => handleSubmit()}>age</button>
        </Container>
      </React.Fragment>
    </div>
  );
}

export default App;
